import { AuthService } from "../services/auth.service";

export class LogoutCommandHandler {
  private _authService: AuthService;

  public constructor() {
    this._authService = new AuthService();
  }

  public async run() {
    console.log('  Login out...');
    await this._authService.logout();
    console.log('  Done');
    console.log();
  }
}